import axios from 'axios';

export let endpoints = {
    "tour_total_all" : "/departure/",
}

export let AuthAPI = axios.create({
    baseURL: 'http://10.225.0.246/vdms_mvc/api/v1',
    headers: {
        'Authorization': `Bearer `
    }
})
export default axios.create({
    baseURL: 'http://10.225.0.246/vdms_mvc/api/v1',
})
